import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for search input and fill with 'iPhone'
    await page.waitForSelector('#searchInput', { timeout: 5000 });
    await page.fill('#searchInput', 'iPhone');
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_search_filled.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_search_filled.png'));

    // Click search button using different selector strategy
    await page.waitForSelector('button.search-btn', { timeout: 5000 });
    await page.click('button.search-btn');

    // Wait for results and take screenshot
    await page.waitForTimeout(1000);
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_search_results.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_search_results.png'));

    // Extract search results data
    const extractedData = {
      searchPerformed: true,
      searchTerm: 'iPhone',
      resultsCount: await page.$$eval('.product-card', elements => elements.length)
    };

    return {
      success: true,
      action: "Successfully searched for 'iPhone' products",
      extractedData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to search for 'iPhone' products",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
